  // }\n      }\n    }\n\n    &__address {\n      display: flex;\n      align-items: center;\n      justify-content: center;\n      gap: 10px;\n      margin-top: 10px;\n      margin-bottom: 20px;\n      line-height: 20px;\n    }\n\n    &__city {\n      summary {\n        // align-items: flex-start;\n        justify-content: flex-start;\n        text-align: left;\n        padding: 20px 0;\n      }\n\n      &[open] > summary {\n        margin-right: -100px;\n      }\n    }\n\n    &__double-controls {\n      display: flex;\n      & > * {\n        display: flex;\n        justify-content: start;\n        gap: 10px;\n        width: 50%;\n        user-select: none;\n        cursor: pointer;\n        margin-bottom: 20px;\n      }\n\n      & > *:last-child {\n        justify-content: end;\n      }\n\n      & * {\n        text-transform: uppercase;\n      }\n    }\n\n    .custom-accord__content {\n      display: none;\n      margin-bottom: 20px;\n      text-transform: uppercase;\n      flex-direction: column;\n\n      &_left {\n        // & *:nth-child(4) {\n        //   opacity: 30%;\n        // }\n      }\n\n      &_right {\n        flex-direction: row;\n        justify-content: space-around;\n        & *:nth-child(1) {\n          opacity: 30%;\n        }\n      }\n\n      &__section {\n        display: flex;\n        flex-direction: column;\n        gap: 10px;\n\n        &:first-child {\n          border-bottom: 2px solid #eee;\n          padding-bottom: 20px;\n\n          & *:nth-child(4) {\n            opacity: 30%;\n          }\n        }\n        &:last-child {\n          // background-color: #00f;\n          padding-top: 20px;\n          & *:nth-child(2) {\n            opacity: 30%;\n          }\n        }\n      }\n    }\n\n    &__map {\n      width: 282px;\n      height: 300px;\n      margin: 30px -30px 30px -30px;\n      border-radius: 20px;\n    }\n\n    &__button {\n      width: 100%;\n      margin-bottom: 10px;\n\n      &:last-child {\n        margin-bottom: 0px;\n      }\n    }\n\n    & > * {\n      letter-spacing: 5%;\n    }\n\n    @include useCompactScroll();\n  }\n\n  .modal-regular {\n    transition: all 0.2s;\n    position: fixed;\n    bottom: 0px;\n    top: $header-height-small;\n    right: 0px;\n    width: 290px;\n\n    // align-items: ;\n\n    // overflow-x: hidden;\n    max-height: calc(100vh - $header-height-small);\n\n    &__content-wrap {\n      width: 100%;\n      height: 100%;\n      background-color: #eee;\n      padding: 20px;\n      display: flex;\n      flex-direction: column;\n      gap: 10px;\n\n      overflow-y: scroll;\n      @include useCompactScroll();\n    }\n\n    #price-close-btn {\n      position: absolute;\n      width: 50px;\n      height: 50px;\n      border-radius: 50%;\n      left: -60px;\n      top: 10px;\n      pointer-events: none;\n      background-color: #fff;\n    }\n\n    &__section {\n      background-color: #fff;\n      padding: 20px;\n      border-radius: 20px;\n\n      display: flex;\n      flex-direction: column;\n      gap: 20px;\n\n      &:first-child {\n        padding: 15px;\n        border: 5px solid $main;\n        display: flex;\n        flex-direction: column;\n\n        .modal-regular__section__header {\n          // background-color: #f00;\n          .super-price-e {\n            position: static;\n          }\n        }\n      }\n\n      &__header {\n        display: flex;\n        flex-direction: column;\n        gap: 10px;\n        position: relative;\n        // margin-bottom: 10px;\n\n        & > *:first-child {\n          font-size: 32px;\n          // margin-bottom: 10px;\n        }\n\n        & > *:last-child {\n          // display: ;\n          position: absolute;\n          // left: ;\n          right: 0px;\n          top: 3px;\n          text-align: center;\n          background-color: #eee;\n          border-radius: 10px;\n          padding: 5px 10px;\n          h3 {\n            font-size: 18px;\n          }\n        }\n      }\n\n      &__icons {\n     